import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './Components/App/App';
import reportWebVitals from './reportWebVitals';
import {
  ApolloClient,
  InMemoryCache,
  ApolloProvider,
  gql
} from "@apollo/client";

const client = new ApolloClient({
    uri: "https://salary-sight-be.herokuapp.com/graphql",
    cache: new InMemoryCache()
});

export const GET_POST = gql `
  query {
      posts {
        id
        company
        salary
        degree
        positionTitle
        state
        jobHuntDuration
        gender
        age
        yearsOfExperience
      }
    }
  `
  export const CREATE_POST = gql `
    mutation createPost($username: String, $gender: String!, $age: Integer!, $gradYear: String!,
      $program: String!, $degree: String!, $firstPosition: String!, $jobHuntDuration: Integer!,
      $yearsOfExperience: Integer!, $positionTitle: String!, $company: String!, $locationOfEmployment: String!,
      $typeOfEmployment: String!, $state: String!, $negotiation: String!, $salary: Integer!) {
      createPost (input: {
        username: $username,
        company: $company,
        salary: $salary,
        degree: $degree,
        positionTitle: $positionTitle,
        state: $state,
        jobHuntDuration: $jobHuntDuration,
        gender: $gender,
        age: $age,
        yearsOfExperience: $yearsOfExperience,
        gradYear: $gradYear,
        program: $program,
        typeOfEmployment: $typeOfEmployment,
        locationOfEmployment: $locationOfEmployment,
        negotiation: $negotiation,
        firstPosition: $firstPosition,
      }) {
        post {
            username
            company
            salary
            degree
            positionTitle
            state
            jobHuntDuration
            gender
            age
            yearsOfExperience
            gradYear
            typeOfEmployment
            locationOfEmployment
            negotiation
            firstPosition
            program
        }
      }
    }
  `

ReactDOM.render(
  <ApolloProvider client={client}>
    <App />
  </ApolloProvider>,
  document.getElementById('root')
);

reportWebVitals();
